import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Header from './Header'; // Assuming you have a Header component
import Home from './Home'; // Assuming you have a Home component
import Contact from './Contact'; // Assuming you have a Contact component
import Sellbook from './Sellbook'; // Assuming you have a Sellbook component
import Books from './Books'; // Assuming you have a Books component
import Auth from './Auth'; // Assuming you have an Auth component

function App() {
  return (
    <>
      <Header />
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='contact' element={<Contact />} />
        <Route path='sellbook' element={<Sellbook />} />
        <Route path='books' element={<Books />} />
        <Route path='login' element={<Auth />} />
        <Route path='register' element={<Auth register />} />
      </Routes>
      {/* Add your Footer component here if needed */}
    </>
  );
}

export default App;
